# https://leetcode.com/problems/longest-substring-without-repeating-characters/submissions/
class Solution:

  # def isUniqueString(self, s):
  #   return len(set(s)) == len(s)

  def lengthOfLongestSubstring(self, s) -> int:
    if len(s) == 0:
        return 0
    maxSubLen = 1
    i = 0
    j = 0
    # Sets faster than list
    # charactersSet = set()

    stringLength = len(s)
    # currentBestSubstring =[]
    currentBestSubstring =""
    while j < stringLength:
        newCharacter = s[j]
        if not newCharacter in currentBestSubstring:
            currentBestSubstring = currentBestSubstring + newCharacter
            j = j + 1
            newSubstringLen = len(currentBestSubstring)
            maxSubLen  = maxSubLen if maxSubLen >=  newSubstringLen else newSubstringLen
        else:
            currentBestSubstring = currentBestSubstring[1:]

    return maxSubLen

